import React, { Component } from 'react'
import {Modal,Button} from 'react-bootstrap';
export default class Registration extends Component {
  render() {
    return (
      <div>
        <Modal>
            <Modal.Header closeButton>Modal Heading</Modal.Header>
            <Modal.Body>
              Hello
              {this.state.CID}
            </Modal.Body>
            <Modal.Footer>
              <Button>Close</Button>
              <Button>Save</Button>
            </Modal.Footer>
          </Modal>
      </div>
    )
  }
}
